import axios from 'axios';
import React, { Component } from 'react';
import Marquee from 'react-marquee-master';
import '../styles/Lists.scss';

export default class Lists extends Component {

    constructor() {
        super()
        this.state = {
            result: false,
        }
    }

    componentDidMount() {

        const _this = this;
        const options = {
            headers: {
                'Content-Type': 'application/json',
            }
        };
        axios.get('http://criminalimpulse.com/api/topplayerlist',  options )
            .then(function (response) {
                const listTopPlayer = response.data;

                _this.setState({
                    result: listTopPlayer
                })
            })
            .catch(function (error) {
                console.log(error);
            });
    }

    render() {

        const { error, isLoaded, result } = this.state;
        console.log(result);
        return(<>
            <div height='300px' className='player-left'>
                <p className='listHeading'>Menu Heading</p>
                <Marquee minHeight='250' marqueeItems={result} />
            </div>
            <div height='300px' className='player-right'>
                <p className='listHeading'>Menu Heading</p>
                <Marquee minHeight='250' marqueeItems={result} />
            </div>
        </>);
    }
}
